import React from 'react'
import logo from '../../img/paugur.svg'
import {
    FloatingContainer,
    LogoContainer
} from './logo.styles'

const Logo = () => {
    return (
        <FloatingContainer>
            <LogoContainer src={logo} alt="Paugur" />
        </FloatingContainer>
    )
}

export default Logo;
